Give the gift of an everlasting bouquet.

Use in any kind of flower arrangements or alone in a tall vase to scent your home all year long with dried Lavender.

Our “Royal Purple”  lavender and is  tied with a ribbon and beautifully wrapped in tissue. Each bouquet comes with a organza sachet bag to place any loose buds from<img class="alignleft  wp-image-1332" src="http://castlerocklavender.com/production/wp-content/uploads/2013/05/DSC00005-300x200.jpg" alt="SONY DSC" width="300" height="200" /> shipment. Each bundle is about 100 stems of about 10 to 14 inches in length.

These beautiful lavender bunches make wonderful additions to your home. Lavender creates a sense of peace, harmony and and tranquility.
